import React from 'react';
import logo from './logo.png';

function Header() {

  return (
    <header className="App-header" style={{ display: "flex", alignItems: "center" }}>
      <img src={logo} className="App-logo" alt="WebForge logo" width="150px" style={{ marginLeft: "10px", margin: "10px", marginRight: "auto"}}/>
      <nav>
        <ul style={{ display: "flex", listStyle: "none", margin: 0 }}>
          <li><a href="#about">About</a></li>
          <li><a href="#education">Education</a></li>
          <li><a href="#skills">Skills</a></li>
          <li><a href="#projects">Projects</a></li>
          <li><a href="#certificates">Certificates</a></li>
          <li><a href="#contact">Contact</a></li>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
